import React from 'react';

export function ContactForm({
    nameInput,
    setNameInput,
    phoneInput,
    setPhoneInput,
    emailInput,
    setEmailInput,
    handleSubmit
}) {
    return (
    <div>
        <form>
            <input type='text' placeholder='Enter name' value={nameInput} onChange={setNameInput}></input>
            <input type='tel' placeholder='Enter phone number' pattern="[0-9]{3}-[0-9]{2}-[0-9]{3}"></input>
            <input type='email' placeholder='Enter e-mail'></input>
            <input type='submit' value='Add Contact'></input>
        </form>
    </div>)
}
